const httpService = "http://localhost:2000"


export const getBooks = async () => {
    try {
      const response = await fetch(`${httpService}/books`);
      const data = await response.json();
      return data;
    } catch (error) {
      console.error("Error fetching books:", error);
      return null;
    }
  };
